import React from 'react';
import Sidebar from './sidebar';
import styles from './profile.module.css';


function Profile() {
    const onChangeFile = async (e) => {

        e.preventDefault(e);
        file = await e.target.files[0];
        setProfilepic(file);

    }


    return (
        <div className={styles.profilewrapper}>

            <Sidebar />

            <form className={styles.formeprofile} >


                <div className={styles.imgprof}>
                    <img src="" alt="" />
                    <label htmlFor="pic" className={styles.chooseimg}>
                        choose image
                    </label>
                    <input className={styles.fileinput} type="file" id="pic" accept="image/*" multiple={false} onChange={onChangeFile} />
                </div>



                <div>

                    <label className={styles.profileinput} htmlFor="">
                        <input type="text" value="username" />
                    </label>


                    <label className={styles.profileinput} htmlFor="">
                        <input type="email" />
                    </label>


                    <label className={styles.profileinput} htmlFor="">
                        <input type="password" />
                    </label>

                    <input type="submit" />

                </div>

            </form>


        </div>
    )
}

export default Profile
